{
  "operationName": "GET_POPULAR_EVENTS",
  "variables": {
    "count": 10,
    "areaId": "41",
    "dateFrom": "2022-11-08",
    "dateTo": "2022-11-14"
  },
  "query": "query GET_POPULAR_EVENTS($count: Int!, $areaId: ID, $dateFrom: DateTime, $dateTo: DateTime) {
  events(limit: $count, type: POPULAR, areaId: $areaId, dateFrom: $dateFrom, dateTo: $dateTo) {
    ...eventFields
 }
}

fragment eventFields on Event {
  title
  date
 content
 images {
  filename
  }
  venue {
 name
    contentUrl
  }
 }
"
